import Sidebar from "./sidebar/Sidebar.js";
import Routes from "./routes/Routes";

import './App.css';

function App() {
  return (
    <div className="App">
        <div>
            <p>I'm the daddy</p>
            <div>
              <Sidebar/>
              <Routes/>
            </div>
        </div>
    </div>
  );
}

export default App;
